import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import "bootstrap/dist/css/bootstrap.min.css";

import ProductList from "./components/productList";
import BuyProduct from "./components/buyProduct";
import SellProduct from "./components/sellProduct";

class App extends Component {

    render() {
	return (
		<Router>
		<div className="container">
		<nav className="navbar navbar-expand-lg navbar-light bg-light">
		<Link to="/" className="navbar-brand">Consortium</Link>
		<div className="collapse navbar-collapse">
		<ul className="navbar-nav mr-auto">
                <li className="navbar-item">
                <Link to="/" className="nav-link">Buy</Link>
                </li>
                <li className="navbar-item">
                <Link to="/create" className="nav-link">Sell</Link>
                </li>
		</ul>
		</div>
		</nav>
		<br/>
		<Route path="/" exact component={ProductList} />
		<Route path="/buy/:id" component={BuyProduct} />
		<Route path="/sell/:id" component={SellProduct} />
		</div>
		</Router>
	);
    }
}

export default App;
